import React from "react";

const ButtonOnUp = () => {
    const onUp = () => {
        window.scrollTo(0, 0)
      }
  return (
    <>
      <button  onClick={() => onUp()}>UP</button>
    </>
  );
};

export default ButtonOnUp;
